import React from "react";
import logo from "../img/logo.svg"
import SettingsBtn from "./SettingBtn";
import lang from "../img/lang.svg"
import arrow from "../img/back.svg"
import dec from "../img/decimal.png"
import wallet from "../img/wallet.svg"

const Header = function () {
    function menuClick(el) {
        const a = document.getElementById('active');
        a.className = "unactive";
        el.target.className = "active"
    }
    return (
        <div className="header">
            <div className="leftContent">
                <div className="logo">
                    <img src={logo} alt="Logo"/>
                    <p>Canyon Swap</p>
                </div>
                <div className="links">
                    <a id="active" href="/" >Главная</a>
                    <a className="unactive" href="/" onClick={menuClick(this)} >Лендинг</a>
                    <a className="unactive" href="/" >FAQ</a>
                    <a className="unactive" href="/">Обратная связь</a>
                </div>
            </div>
            <div className="rightContent">
                <SettingsBtn imgOnePath={lang} label={"RU"} imgTwoPath={arrow}/>
                <SettingsBtn imgOnePath={dec} label={"Decimal"}/>
                <SettingsBtn imgOnePath={wallet} label={"Connect wallet"}/>
            </div>

        </div>
    );
}
export default Header;
